import { FieldType } from "./deserialization/FieldType";
import JsonDeserializationHelper from "./deserialization/JsonDeserializationHelper";
import Guest from "./Guest";

export default class GuestList {
    readonly guests : Guest[];

    constructor(guests : Guest[]) {
        this.guests = guests;
    }

    static deserialize = (json : any) => {
        const guests = JsonDeserializationHelper.assertField(json, 'guests', FieldType.ARRAY(Guest.deserialize));

        return new GuestList(guests);
    }
}
